import React from 'react';
import {Box, ThemeProvider} from "@mui/material";
import {themeOptions} from "./theme";

function App() {
    return (
        <ThemeProvider theme={themeOptions}>
            <Box>

            </Box>
            <Box
                sx={{
                    height: "800px",
                    backgroundColor: "#FFF5DC"
                }}>

            </Box>
        </ThemeProvider>

    );
}

export default App;
